def prime_up_to(n):
    if n < 2:
        return []

    # initialize an array to store prime numbers
    primes = []

    # iterate through all numbers from 2 to n
    for i in range(2, n):
        is_prime = True

        # check if the number is divisible by any number less than itself
        for j in range(2, i):
            if i % j == 0:
                is_prime = False
                break

        # if the number is not divisible by any number less than itself, it is prime
        if is_prime:
            primes.append(i)

    return primes

def prime_up_to(n):
    primes = []
    for i in range(2, n):
        is_prime = True
        for j in range(2, int(i ** 0.5) + 1):
            if i % j == 0:
                is_prime = False
                break
        if is_prime:
            primes.append(i)
    return primes

